    },
    {
      id: 4,
      title: "Carwash Cost",
      amount: 24.99,
      date: new Date(2021 ,4, 28)
    },
  ]
  console.log(expenses)
  const addExpenseHandler = expense => {
    console.log('In App.js')
    console.log(expense)
  }

  return (
    <div>
      <NewExpense onAddExpense={addExpenseHandler} />
      <Expenses items={expenses} />
    </div>
  );
}

export default App;
